import React from 'react'
import HomeIcon from '@mui/icons-material/Home';
import SmartButtonSharpIcon from '@mui/icons-material/SmartButtonSharp';
import BookmarksSharpIcon from '@mui/icons-material/BookmarksSharp';
import AutoStoriesSharpIcon from '@mui/icons-material/AutoStoriesSharp';
import NewspaperSharpIcon from '@mui/icons-material/NewspaperSharp';

export const Sidedata = [
    {
        title: "Home",
        icon: <HomeIcon/>,
        link: "./Home"
    },
    {
        title: "Genre",
        icon: <martButtonSharpIcon/>,
        link: "./Genre"
    },
    {
        title: "Bookmark",
        icon: <BookmarksSharpIcon/>,
        link: "./Bookmark"
    },
    {
        title: "Manga",
        icon: <AutoStoriesSharpIcon/>,
        link: "./Manga"
    },
    {
        title: "News",
        icon: <NewspaperSharpIcon/>,
        link: "./News"
    },
]
